# 时间复杂度 O(NlogN)
# 最坏的情况的复杂度为 O(N^2)
"""
快速排序的问题：
1、递归
2、最坏情况的复杂度
"""

"""
一堆相同的数过不了leetcode， 详情看 最底下的注释
"""

import random
from typing import List


def sort(arr: List[int], left: int, right: int):
    """
    快速排序
    :param arr:列表数组
    :param left: 左下标
    :param right: 右下标
    :return: None
    """
    if left < right:
        midIndex = partSort(arr=arr, left=left, right=right)
        # 排序新的左边
        sort(arr=arr, left=left, right=midIndex - 1)
        # 排序新的右边
        sort(arr=arr, left=midIndex + 1, right=right)


def partSort(arr: List[int], left: int, right: int) -> int:
    """
    部分的排序(分治)
    :param arr:
    :param left:
    :param right:
    :return: 中间数的下标
    """
    # 为了防止最坏情况的发生，什么是最坏的情况，比如一个已经拍过序的数组
    # 就让第一个数和随机下标的那个数进行交换一下
    changeIndex = random.randint(a=left,b=right)
    arr[left], arr[changeIndex] = arr[changeIndex], arr[left]
    # 先取出第一个数
    firstNum = arr[left]
    while left < right:
        # 从右向左查找比firstNum小的数
        while left < right and arr[right] >= firstNum:
            right -= 1

        # 找到比firstNum小的数，直接放在下标为left的位置上
        arr[left] = arr[right]

        # 从左向右查找比firstNum大的数
        while left < right and arr[left] <= firstNum:
            left += 1

        # 找到比firstNum大的数，直接放在下标为right的位置上
        arr[right] = arr[left]

    # 将第一个数直接放在中间的位置，此时的中间的下标为left = right
    arr[left] = firstNum
    return left



def test():
    arr = [5, 3, 4, 2, 6, 1]
    sort(arr=arr, left=0, right=len(arr) - 1)
    print(arr)


test()


